webpackJsonp([0xa05207d66bea],{2945:function(e,n){e.exports={pathContext:{docHtml:"<h1>node-http-signature changelog</h1>\n<h2>1.1.1</h2>\n<ul>\n<li>Version of dependency <code>assert-plus</code> updated: old version was missing\nsome license information</li>\n<li>Corrected examples in <code>http_signing.md</code>, added auto-tests to\nautomatically validate these examples</li>\n</ul>\n<h2>1.1.0</h2>\n<ul>\n<li>Bump version of <code>sshpk</code> dependency, remove peerDependency on it since\nit now supports exchanging objects between multiple versions of itself\nwhere possible</li>\n</ul>\n<h2>1.0.2</h2>\n<ul>\n<li>Bump min version of <code>jsprim</code> dependency, to include fixes for using\nhttp-signature with <code>browserify</code></li>\n</ul>\n<h2>1.0.1</h2>\n<ul>\n<li>Bump minimum version of <code>sshpk</code> dependency, to include fixes for\nwhitespace tolerance in key parsing.</li>\n</ul>\n<h2>1.0.0</h2>\n<ul>\n<li>First semver release.</li>\n<li>\n<h1>36: Ensure verifySignature does not leak useful timing information</h1>\n</li>\n<li>\n<h1>42: Bring the library up to the latest version of the spec (including the</h1>\n<p>   request-target changes)</p>\n</li>\n<li>Support for ECDSA keys and signatures.</li>\n<li>Now uses <code>sshpk</code> for key parsing, validation and conversion.</li>\n<li>Fixes for #21, #47, #39 and compatibility with node 0.8</li>\n</ul>\n<h2>0.11.0</h2>\n<ul>\n<li>Split up HMAC and Signature verification to avoid vulnerabilities where a\nkey intended for use with one can be validated against the other method\ninstead.</li>\n</ul>\n<h2>0.10.2</h2>\n<ul>\n<li>Updated versions of most dependencies.</li>\n<li>Utility functions exported for PEM => SSH-RSA conversion.</li>\n<li>Improvements to tests and examples.</li>\n</ul>",docPath:"argo-ci/node_modules/node-pre-gyp/node_modules/http-signature/changes",proj:"argo-ci"}}}});
